import './App.css';
import { Navbar } from './components/Navbar';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import {Login} from './pages/Login';

function App() {
  return (
    <>
        <Router>
            <Navbar />
            <Switch>
                <Route path='/' exact />
                <Route path='/' exact />
            </Switch>
        </Router>

        <main className='form-signin'>
            <Login />
        </main>
    </>
  );
}

export default App;
